import React from 'react';
import ReactDom from 'react-dom';



const AppHeader = () => {
    return <h1>
        My Todo List</h1>
}

const SearchPanel = () => {
    return <input placeholder="search"/>
}

const App = () => {
    const loginBox = <span> Log in please</span>
    return (
        <div>
            {loginBox}
            <AppHeader/>
            < SearchPanel/>
            <TodoList/>
        </div>
    )
}

ReactDom.render(
    <App/>, document.getElementById('root'));
